import Button from '@material-ui/core/Button'
import API from '../../utils/API';
import "./End.css";

function End()
{
    const res = localStorage.getItem("last");
    const user = API.getUserInfo();
    return (
		<div class="end">
            <div class="inner">
                <h1>{(res === "win" ? "You Win!" : "You loose..." )}</h1>
                <span>V {user.victories} | {user.defeats} D</span>
                <Button color="primary" variant="contained" onClick={() => this.startGame()} block>
                Retry?
                </Button>
                <Button color="primary" variant="contained" onClick={() => window.location = "/menu"} block>
                Return to Menu
                </Button>
            </div>
		</div>);
}
export default End;
